import React from 'react';
import ebay from '../images/clients/ebaylogo.png'; // Renamed import for clarity
import amazon from '../images/clients/amazon.png'; // Renamed import for clarity

const Clients = () => {
    return (
        <div className="mt-8 bg-gray-100 flex flex-col items-center"> {/* Centered vertically */}
            <section data-aos="fade-up" className="text-center">
                <div className="my-4 py-4">
                    <h2 className="my-2 text-3xl text-blue-900 uppercase font-bold">Our Clients</h2>
                    <div className='my-2'>
                        <div className='w-24 mx-auto border-b-4 border-blue-900'></div>
                    </div>
                    <h2 className="mt-4 text-xl lg:text-2xl font-semibold text-blue-900">Some of our clients.</h2>
                </div>
            </section>

            <div className="p-16" data-aos="fade-in" data-aos-delay="600">
                <div className="flex justify-center items-center gap-8">
                    {/* Setting both height and width to ensure uniform size */}
                    <img src={ebay} alt="eBay" style={{ height: '10rem', width: '10rem', objectFit: 'contain' }} />
                    <img src={amazon} alt="Amazon" style={{ height: '10rem', width: '10rem', objectFit: 'contain' }} />
                </div>
            </div>
        </div>
    );
}

export default Clients;
